import React, { useState, useEffect } from 'react';
import Transaction from './Transaction.js'

function Transactions() {
	const [date, setDate] = useState('');
	const [vendor, setVendor] = useState('');
	const [category, setCategory] = useState('');
	const [status, setStatus] = useState('');
	const [amount, setAmount] = useState('');

	useEffect(() => {
		fetch('http://localhost:3000/transactions', {
			method: 'get',
			headers: {'Content-Type': 'application/json'},
			body: JSON.stringify({
			  "date": setDate(date)
			  // "vendor": setVendor(vendor),
			  // "category": setCategory(category),
			  // "status": setStatus(status),
			  // "amount": setAmount(amount) 
			})
		})
			.then(response => response.json())
			.then(data => {
				console.log(data[0].date)
			})
	},[])

	return (
		<div>
			<div>
				<h3 className="fl w-20 pa1 tc">Date</h3> 
				<h3 className="fl w-20 pa1 tc">Vender</h3> 
				<h3 className="fl w-20 pa1 tc">Amount</h3> 
				<h3 className="fl w-20 pa1 tc">Status</h3> 
				<h3 className="fl w-20 pa1 tc">Category</h3>
			</div>
			<div>
				<Transaction
					date = {date}
					vendor={vendor}
					amount={amount}
					status={status}
					category={category}
				/>
			</div>
		</div>
		);

}

export default Transactions;
